import React, { Component } from "react";
import "./Card2.css";
const Card2 = () => {
  return (
    <div className="Card2">
      <div
        className="ctn1"
        style={{
          backgroundImage:
            "url(https://images.bfmtv.com/RxO3TGwT51kwE4S_0aFVsNVoKbk=/4x3:996x561/640x0/images/-76356.jpg)",
        }}
      >
        1
      </div>
      <div className="ctn2">2</div>
      <div className="ctn3">3</div>
    </div>
  );
};

export default Card2;
